INSERT INTO `feedback` (`id`, `name`, `email`, `message`) VALUES
(8, 'Umar Akhlaq', 'umar.akhlaq112@gmail.com', 'Hello Sanwal and Ali,\nGood to see you website MASHALLAH best hai guys.Kindly upload your portfolio to make it more interesting.\n'),
(9, 'Ali Siraj Badri', 'ali.siraj1999@gmail.com', 'Great atmosphere'),
(18, 'Ansar Habib', 't82747k@gmail.com', 'Hello Aoa,\n Sir i want to apply for internship in webdesigning and development. I am doing software engineering from aptech multan. So now i want to get some professional experience. Please reply then i will send you my cv.\nThank you'),
(19, 'Sana Mukhtar', 'gothic_princess52@yahoo.com', 'Showcase is very appealing, but you dont have to put a laptop picture for every website design. \nIt looked like a google images page for the search "photoshopped pictures of laptops" \nKindly, look into the matter and try showing the websites in a more unique way'),
(69, '', '', ''),
(70, '', '', ''),
(71, '', '', ' AND SLEEP(03)'),
(72, 'Pink', 'p4tzl1c7cv4@outlook.com', 'Howdy would you mind sharing which blog platform you&#8217;re using? I&#8217;m going to start my own blog in the near future but I&#8217;m having a tough time making a decision between Blisongone/Wordpresg/B2evElution and Drupal. The reason I ask is because your design and style seems different then most blogs and I&#8217;m looking for something unique.                  P.S Apologies for getting off-topic but I had to ask!'),
(73, 'Bubby', 'd1itvdkqr8@hotmail.com', 'Not sure that you will be able to get a bus pass as proof of pernemant residence is usually required.  However if you want to check this out there are links to bus pass info arranged by local areas from this page:'),
(74, 'Noman zaffarut ', 'nomanzaffar130@gmail.com', 'aoa sir...!! ma aptech se softwear engineering kr rha ho mujhe html use krna ata hai bs kuch training ki zarort hai mujhe intership pr rakh lyn plz sir apki mehrbani ho ge'),
(75, 'Pa ga l', 'info@petromex.org', 'Che Chung ni pyn yaun'),
(76, 'Ebube', 'info@elfrique.com', 'Good Day Queper Technologies,\n\nPlease we need an URGENT verification of Hira Malik. \n\nWe are currently in a serious business talks with one Hira Malik who says he is the marketing manager and individual project lead of IT department at Queper Technologies. He said he is representing your company.\n\nWe have agreed under his representation that Queper Technologies will develop a website for us on an already agreed fee. And we have requested that he should provide us with a COMPANY BANK account details fo'),
(77, 'Sabrina Warren', 'jmwbbe@jtyyzaziduf.com', 'Hello my name is Sabrina Warren and I just wanted to send you a quick note here instead of calling you. I discovered your Queper Technologies page and noticed you could have a lot more traffic. I have found that the key to running a successful website is making sure the visitors you are getting are interested in your subject matter. There is a company that you can get keyword targeted visitors from and they let you try their service for free for 7 days. I managed to get over 300 targeted visitors to day to '),
(78, 'Sabrina Warren', 'qxcjdrzjhh@uojyqd.com', 'Hi my name is Sabrina Warren and I just wanted to send you a quick note here instead of calling you. I discovered your Queper Technologies website and noticed you could have a lot more traffic. I have found that the key to running a popular website is making sure the visitors you are getting are interested in your website topic. There is a company that you can get keyword targeted traffic from and they let you try the service for free for 7 days. I managed to get over 300 targeted visitors to day to my site'),
(79, 'kmklm', 'lkm@h.com', 'lasdasd');
