INSERT INTO `main_content` (`var`) VALUES
('\n \n \n \n \n   <div class="page" style="margin-top: 10px;">\n    <div class="generic">\n      <div class="panel">\n        <div class="title">\n        <div class="content">\n        <div id="logoDIV_1" style="width: 1000px;">\n    <div id="logoDIV_2">\n        <h1 id="logoH2_3">\n            Design a <strong id="logoSTRONG_4">unique Logo</strong></h1>\n        <p id="logoP_5" style=" font-size:14px; color:black;">\n            Use our FREE logo design tool to create a stunning logo for your business and print it on any of our products! Testing</p> <a href="/promologobuilder" id="logoA_6">Create a logo</a>\n    </div><img src="images/logoDesign.png" alt="" id="logoIMG_7">\n</div>\n  \n        </div>\n      </div>\n        </div>\n      </div>\n\n      \n    </div>\n\n\n     <div class="page" style="margin-top: 10px;">\n    <div class="generic">\n      <div class="panel">\n        <div class="title">\n        <div class="content" style="margin-top: -50px;">\n       <div id="stDIV_1" style="width: 1000px;">\n<table>\n  <tbody><tr>\n    <td> <div id="stDIV_2">\n        <div class="title">\n          <h1>We are <font size="5"><strong>  &nbsp;Design Citi!</strong></font></h1>\n        </div>\n        <p id="stP_5" style=" font-size:14px; color:black;">\n            At Design Citi ! we believe passionately in quality, but remain dedicated to simplicity. With nine out of ten online print sites making ordering a chore, we try to make your life easier.\n        </p> <a href="/about-us" id="stA_6">Find out who we are</a>\n    </div></td>\n    <td> <ul id="stUL_7">\n        <li id="stLI_8">\n            <img src="images/car.png" alt="" id="stIMG_9" style="margin-top:-2px;"> <span id="stSPAN_10" style=" font-size:14px; color:black;">Next day delivery available</span>\n        </li>\n        <li id="stLI_11">\n            <img src="images/perfect.png" alt="" id="stIMG_12"> <span id="stSPAN_13" style=" font-size:14px; color:black;">A perfect design, every time</span>\n        </li>\n        <li id="stLI_14">\n            <img src="images/sati.png" alt="" id="stIMG_15"> <span id="stSPAN_16" style=" font-size:14px; color:black;">100% satisfaction guaranteed</span>\n        </li>\n    </ul></td>\n  </tr>\n</tbody></table>\n   \n   \n</div>\n  \n        </div>\n      </div>\n        </div>\n      </div>\n\n      \n    </div>\n\n\n\n      <div class="page" style="margin-top: 10px; ">\n    <div class="generic">\n      <div class="panel">\n        <div class="title">\n        <div class="content" style="margin-top: -60px;">\n<div id="reviewDIV_1" style="height:300px;">\n\n           <div class="title" style="margin-left: 300px; margin-top: 50px">\n          <h1><font size="5"><strong>What Our</strong></font> &nbsp;Customers Say</h1>\n        </div>\n \n\n          <div id="reviewDIV_5">\n        <div id="reviewDIV_6">\n            <span id="reviewSPAN_7"></span><span id="reviewSPAN_8"></span><span id="reviewSPAN_9"></span><span id="reviewSPAN_10"></span><span id="reviewSPAN_11"></span>\n        </div>\n        <div id="reviewDIV_12">\n            <p id="reviewP_13" style=" font-size:12px; color:black;">\n                <strong>Hamilton Designs ltd.</strong>\n            </p>\n        </div>\n        <div id="reviewDIV_14">\n            <p id="reviewP_15" style="width: 400px;  font-size:12px; color:black;">\n                I have been working with Design Citi ! from the start, after someone recommended Design Citi ! to me. I trust Design Citi ! with all my promotional printing needs as I am very satisfied with service,quality and speed of their delivery. Keep up the good work!\n            </p>\n        </div>\n        <div id="reviewDIV_16" style=" font-size:12px; color:black; margin-top: 0px">\n        <br>\n            <strong>Edward Hamilton</strong>\n        </div>\n    </div>\n \n          <div id="reviewDIV_17">\n        <div id="reviewDIV_18">\n            <span id="reviewSPAN_19"></span><span id="reviewSPAN_20"></span><span id="reviewSPAN_21"></span><span id="reviewSPAN_22"></span><span id="reviewSPAN_23"></span>\n        </div>\n        <div id="reviewDIV_24">\n            <p id="reviewP_25" style=" font-size:12px;">\n               <strong> Susan Kitchen Ltd. </strong>\n            </p>\n        </div>\n        <div id="reviewDIV_26">\n            <p id="reviewP_27" style="width: 400px;  font-size:12px; color:black;">\n                Design Citi ! attention to detail &amp; customer service won me over - even before the order had arrived. Yet again, I was won over by the quality and packaging. My flags arrived well in time for the event! Design Citi ! has just made it onto my supplier list!\n            </p>\n        </div>\n        <div id="reviewDIV_28" style=" font-size:12px; color:black; margin-top: 0px">\n           <br>\n            <strong>Susan Scott</strong>\n        </div>\n    </div>\n\n    \n    \n</div>\n  \n        </div>\n      </div>\n        </div>\n      </div>\n\n      \n    </div>\n\n\n\n      <div class="page" style="margin-top: 10px; background-color: #e1ece7;">\n    <div class="generic">\n        <div class="title">\n        <div class="content" style=" background-color: #e1ece7; ">\n       <table width="50%" align="center">\n     <tbody><tr>\n         <td>\n             <a href="/pro" id="newA_2" style="width: 304px; "><span id="newSPAN_3" style=""><strong id="newSTRONG_4"><strong style="font-size:20px;">Design Citi ! PRO</strong></strong><br id="newBR_5">Exclusively for professionals</span></a> \n         </td>\n         <td>\n             <a href="/print-management" id="newA_6" style="width: 304px; "><span id="newSPAN_7" style=""><strong id="newSTRONG_8"><strong style="font-size:20px;">Print Management</strong></strong><br id="newBR_9">Dedicated to medium enterprises</span></a>\n         </td>\n         <td>\n             <a href="/non-profit" id="newA_10" style="width: 304px; "><span id="newSPAN_11" style=""><strong id="newSTRONG_12"><strong style="font-size:20px;">Non-profit</strong></strong><br id="newBR_13">Exclusive benefits for charity</span></a>\n         </td>\n     </tr>\n </tbody></table>\n        </div>\n      </div>\n      </div>\n\n      \n    </div>    ');
